 INTO THE CARTRIDGE. FLUID DOES NOT DRAIN INTO THE CARTRIDGE.OR *FALCON-OMMENDED CLEANERS:\\n\\nSNAP THE DIVERTER SHIELD INTO PLACE REMOVE DIVERTER AND WIPE CLEAN\\nSPRAY (MIST) FALCON-RECOMMENDED* CLEANER ONTO BOWL\\nWIPE CLEAN THE ENTIRE OUTSIDE AND INSIDE OF BOWL AND REPLACE DIVERTER\\nNEVER DUMP CLEANING SOLUTIONS OR OTHER LIQUIDS INTO BOWL\\n\\n%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%\\n\\nWATERLESS URINAL\\nZURN WATERLESS URINAL  MAINTENANCE\\n\\n1.) RECOMMENDED DAILY MAINTENANCE OF THE\\nZURN  URINAL SUGGESTS WIPING THE WALLS\\nOF THE URINAL WITH A MILD SOAP AND WATER.\\nAVOID DUMPING AGGRESSIVE CLEANERS AND/OR\\nLARGE AMOUNTS OF LIQUIDS DOWN THE URINAL\\nDRAIN. DOING SO MAY DEPLETE THE\\nAQUAGREENTM SEALANT AND ALLOW SEWER\\nGASES TO BACK UP INTO THE RESTROOM.\\n1.) IT IS CRITICAL THAT A LAYER OF ZURN\\nAQUAGREENTM URINAL SEALANT BE MAINTAINED\\nAT ALL TIMES. TO KEEP THE ZURN\\n URINAL FUNCTIONING PROPERLY AND\\nODOR FREE, ADD 3 TO 4 OUNCES OF ZURN\\nAQUAGREENTM SEALANT TO THE TRAP AFTER\\nEVERY 3,000 USES.\\nMAINTENANCE SCHEDULES\\nRECOMMENDED DAILY MAINTENANCE RECOMMENDED PERIODIC MAINTENANCE\\nEVERY 3,000 USES)\\nTRAP CLEANING\\n2.) UNSCREW AND REMOVE BELL TRAP. IF THE\\nBELL TRAP WILL NOT LOOSEN BY HAND, USE A 3/8”\\nRATCHET AND EXTENSION, TURNING COUNTERCLOCKWISE\\nTO REMOVE.\\n1.) REMOVE STRAINER FROM URINAL.\\nRECOMMENDED PERIODIC TRAP CLEANING (EVERY 9,000 USES)\\n5\\n3.) CLEAN STRAINER, BELL TRAP AND TRAPWAY WITH\\nMILD SOAP AND WATER.\\n** IMPORTANT** DO NOT USE HEAVY CLEANERS OR\\nDETERGENTS.\\nPOUR TWO TO THREE GALLONS OF WARM WATER DOWN\\nDRAIN HOLE TO FLUSH URINAL TRAPWAY AND DRAIN\\nLINE.\\n4.) CHECK O-RING ON BELL TRAP. REPLACE\\nIF NEEDED. REINSTALL BELL TRAP WITH O-RING.\\nTIGHTEN SNUG WITH 3/8” RACHET AND EXTENSION\\nTURNING CLOCKWISE. BE CAREFUL NOT TO\\nOVERTIGHTEN.\\nINSTALL STRAINER AND REFILL TRAPWAY WITH\\nAPPROXIMATELY 1 QUART OF WATER. CHECK\\nASSEMBLY FOR LEAKS. ADD 4 OUNCES OF ZURN\\nAQUAGREENTM SEALANT TO THE TRAPWAY.\\nA CL