                "TOM & BETTY PETWAY HALL (COE&HS)--",
                "WATERLESS URINALS PM\\nTHIS FOR THE KOHLER\\n\\nKOHLER\\n WATERLESS URINAL MAINTENANCE\\n\\nAS WITH ANY PLUMBING PRODUCT, ROUTINE MAINTENANCE IS ESSENTIAL TO\\nENSURING OPTIMAL PERFORMANCE AND A CLEAN APPEARANCE. WITH THEIR\\nCARTRIDGE-FREE DESIGN, HOWEVER, KOHLER WATERLESS URINALS ARE\\nSIGNIFICANTLY EASIER TO MAINTAIN THAN CARTRIDGE-BASED OR WATER-BASED\\nURINALS. THE KOHLER WATERLESS URINAL SEALING LIQUID AND\\nKOHLER WATERLESS URINAL CLEANER ARE THE ONLY PRODUCTS REQUIRED\\nFOR PROPER MAINTENANCE.\\n\\n\\nDAILY MAINTENANCE\\n\\nRECOMMENDED DAILY MAINTENANCE REQUIRES SPRAYING DOWN THE OUTSIDE SURFACES\\nWITH THE KOHLER WATERLESS URINAL CLEANER AND WIPING THEM CLEAN.\\n\\n\\nBIMONTHLY FLUSH OUT*\\n\\nSTEP # 1\\n\\nREMOVE STRAINER, POUR A GALLON OF WATER INTO THE TRAP WAY TO PURGE THE SYSTEM OF\\nLIQUID WASTE AND OLD SEALING LIQUID.\\n\\nSTEP # 2\\nPOUR 1 OUNCE OF KOHLER WATERLESS URINAL CLEANER DIRECTLY INTO THE DRAIN.\\nWAIT 5 MINUTES.\\n\\nSTEP # 3\\nPOUR 2 GALLONS OF WATER INTO THE TRAP WAY TO CLEAR ANY REMAINING LIQUID WASTE\\nAND HELP FURTHER CLEAR THE WASTE LINES.\\n",
