                "{\\"id\\":\\"ASSIGNED\\",\\"value\\":\\"ASSIGNED\\",\\"latitude\\":0.0,\\"longitude\\":0.0}",
                "Y",
                "SKINNER-JONES HALL NORTH--",
                "WATERLESS URINALS PM\\nTHIS FOR THE SLOAN\\n\\n1.USING THREE PLASTIC GLOVE, INSERT PLASTIC KEY INTO CARTRIDGE\\nTURN COUNTERCLOCKWISE, FROM 12 O' CLOCK TO 11 O' CLOCK POSITION\\nONCE FREE, LIFT UPWARD CAREFULLY ALLOWING FLUIDS TO DRAIN MOMENTARILY\\nPLACE CARTRIDGE INTO DISPOSAL BAG\\n\\n2. TO ENSURE A CLEAR, CLEAN DRAIN LINE ALWAYS CAREFULLY FLUSH THE OPEN LINE WITH 1-2 BUCKETS OF WARM SOAPY WATER- ENSURING THE BOTTOM OF HOUSING LINE ARE CLEAN & THERE'S GOOD FLOW.\\n\\n3. WIPE CLEAN THE HOUSING RIM AREA THIS HELPS PREVENT STICKING OF CARTRIDGES.  USING THE KEY PROVIDED, LOWER THE CARTRIDGE INTO THE HOUSING AT 11 O' CLOCK POSITION. TURN CLOCKWISE TO THE 12 O' CLOCK POSITION - LOCKING CARTRIDGE INTO THE HOUSING.\\n\\n4. FILL THE CARTRIDGE WITH APPROXIMATELY 32 OZ. OF WATER OR UNTIL THERE NO AIR BUBBLES ESCAPING FROM THE CARTRIDGE.\\n\\n5. ADD BLUE SEALANT TO CARTRIDGE. ALLOW SEALANT TO DRAIN INTO THE CARTRIDGE UNTIL ONLY TRACE AMOUNTS REMAIN.\\n\\n%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%\\n\\nFALCON WATERFREE URINALS\\nCLEANING AND CARTRIDGE CHANGE INSTRUCTIONS\\n\\nINSERT KEY INTO CARTRIDGE\\nPOUR 1 GALLON OF SOAPY WATER INTO CARTRIDGE TO DISPLACE URINE\\nTURN KEY TO LEFT TO UNLOCK\\nLIFT AND TILT CARTRIDGE TO DRAIN ALL FREE LIQUIDS THEN SPRAY FALCON FOAM CLEANER** INTO HOUSING\\nWITH DIVERTER SHIELD REMOVED, FILL CARTRIDGE WITH 1 QUART OR MORE OF CLEAN WATER UNTIL THERE ARE NO AIR BUBBLES\\nADD BLUE SEALANT (ALLOW TIME TO DRAIN INTO CARTRIDGE)\\nSPRAY (MIST) FALCON-RECOMMENDED* CLEANER AND WIPE CLEAN\\nPLACE CARTRIDGE INTO BAG, TIE BAG TO SEAL AND DISPOSE\\nSCRUB THE HOUSING AND DEEP INSIDE THE TAILPIPE WITH A LONG 1.5-INCH DIAMETER NYLON BRUSH**\\nFLUSH HOUSING WITH 5 GALLONS OF HOT SOAPY WATER THEN WIPE CLEAN INNER STAINLESS STEEL RIM\\nINSERT NEW CARTRIDGE INTO HOUSING AND TURN KEY TO RIGHT TO LOCK\\nCARTRIDGE CHANGE AND CLEANING\\n\\nWHEN SHOULD A CARTRIDGE BE CHANGED?\\n\\nBLUE SEALANT APPEARS ON TOP OF THE CARTRIDGE FLUID FLOWS VERY SLOWLY INTO THE CARTRIDGE. FLUID DOES NOT DRAIN INTO THE CARTRIDGE.OR *FALCON-OMMENDED CLEANERS:\\n\\nSNAP THE DIVERTER SHIELD INTO PLACE REMOVE DIVERTER AND WIPE CLEAN\\nSPRAY (MIST) FALCON-RECOMMENDED* CLEANER ONTO BOWL\\nWIPE CLEAN THE ENTIRE OUTSIDE AND INSIDE OF BOWL AND REPLACE DIVERTER\\nNEVER DUMP CLEANING SOLUTIONS OR OTHER LIQUIDS INTO BOWL\\n\\n%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%\\n\\nWATERLESS URINAL\\nZURN WATERLESS URINAL  MAINTENANCE\\n\\n1.) RECOMMENDED DAILY MAINTENANCE OF THE\\nZURN  URINAL SUGGESTS WIPING THE WALLS\\nOF THE URINAL WITH A MILD SOAP AND WATER.\\nAVOID DUMPING AGGRESSIVE CLEANERS AND/OR\\nLARGE AMOUNTS OF LIQUIDS DOWN THE URINAL\\nDRAIN. DOING SO MAY DEPLETE THE\\nAQUAGREENTM SEALANT AND ALLOW SEWER\\nGASES TO BACK UP INTO THE RESTROOM.\\n1.) IT IS CRITICAL THAT A LAYER OF ZURN\\nAQUAGREENTM URINAL SEALANT BE MAINTAINED\\nAT ALL TIMES. TO KEEP THE ZURN\\n URINAL FUNCTIONING PROPERLY AND\\nODOR FREE, ADD 3 TO 4 OUNCES OF ZURN\\nAQUAGREENTM SEALANT TO THE TRAP AFTER\\nEVERY 3,000 USES.\\nMAINTENANCE SCHEDULES\\nRECOMMENDED DAILY MAINTENANCE RECOMMENDED PERIODIC MAINTENANCE\\nEVERY 3,000 USES)\\nTRAP CLEANING\\n2.) UNSCREW AND REMOVE BELL TRAP. IF THE\\nBELL TRAP WILL NOT LOOSEN BY HAND, USE A 3/8”\\nRATCHET AND EXTENSION, TURNING COUNTERCLOCKWISE\\nTO REMOVE.\\n1.) REMOVE STRAINER FROM URINAL.\\nRECOMMENDED PERIODIC TRAP CLEANING (EVERY 9,000 USES)\\n5\\n3.) CLEAN STRAINER, BELL TRAP AND TRAPWAY WITH\\nMILD SOAP AND WATER.\\n** IMPORTANT** DO NOT USE HEAVY CLEANERS OR\\nDETERGENTS.\\nPOUR TWO TO THREE GALLONS OF WARM WATER DOWN\\nDRAIN HOLE TO FLUSH URINAL TRAPWAY AND DRAIN\\nLINE.\\n4.) CHECK O-RING ON BELL TRAP. REPLACE\\nIF NEEDED. REINSTALL BELL TRAP WITH O-RING.\\nTIGHTEN SNUG WITH 3/8” RACHET AND EXTENSION\\nTURNING CLOCKWISE. BE CAREFUL NOT TO\\nOVERTIGHTEN.\\nINSTALL STRAINER AND REFILL TRAPWAY WITH\\nAPPROXIMATELY 1 QUART OF WATER. CHECK\\nASSEMBLY FOR LEAKS. ADD 4 OUNCES OF ZURN\\nAQUAGREENTM SEALANT TO THE TRAPWAY.\\nA CLEANING (CONTINUED)\\nRECOMMENDED PERIODIC TRAP CLEANING (EVERY 9,000 USES)\\n                             %%%%%%%%%%%%%%%%%%%%%%%%%%%%\\nTROUBLESHOOTING PROBLEM STRONG ODOR IS EMINATING  FROM URINAL.REME",
